import React from "react";

const userInfo = [
  {
    id: 1,
    name: "_yum_s",
    time: "16분 전",
  },
  {
    id: 2,
    name: "drink_eat_drink",
    time: "3시간 전",
  },
  {
    id: 3,
    name: "hyukyc",
    time: "20시간 전",
  },
  {
    id: 4,
    name: "jimikeek",
    time: "10시간 전",
  },
];

const StoryUser = () => {
  return (
    <div className="storyUser">
      <img
        src="data:image/jpeg;base64,"
        alt=""
      />
      {userInfo.map((el) => (
        <div className="storyUserTime">
          <p>{userInfo.name}</p>
          <p>{userInfo.time}</p>
        </div>
      ))}
    </div>
  );
};

export default StoryUser;
